"original": |2-
     "page-ranges-supported" is a boolean value indicating whether the
     Printer is capable of supporting the printing of page ranges.  This
     capability can differ from one PDL to another.  There is no
     "page-ranges-default" attribute.  If the "page-ranges" attribute is
     not supplied by the Client, all pages of the Document are printed.
"fixed": |-
  "page-ranges-supported" is a boolean value indicating whether the Printer is capable of supporting the printing of page ranges.  This capability can differ from one PDL to another.  There is no "page-ranges-default" attribute.  If the "page-ranges" attribute is not supplied by the Client, all pages of the Document are printed.
"ko": |-
  "page-ranges-supported"는 프린터가 페이지 범위 인쇄를 지원할 수 있는지 여부를 나타내는 부울 값입니다. 이 기능은 PDL마다 다를 수 있습니다. "페이지 범위-기본" 속성이 없습니다. 클라이언트가 "페이지 범위" 속성을 제공하지 않으면 문서의 모든 페이지가 인쇄됩니다.
